function Geografia(){this.CargarProvincias=function(n){let t="PkProvincia",i="Nombre";$backend.GetToBackend("Provincia").then(r=>{var u,f;for(console.log(r),u=0;u<r.length;u++)f=r[u],$(n).append(new Option(f[i],f[t]));$(n).selectpicker("refresh")})};this.CargarProvinciasSelected=function(n,t){let i="PkProvincia",r="Nombre";console.log("Seleccionar: "+t);$backend.GetToBackend("Provincia").then(u=>{var f,e;for(console.log(u),f=0;f<u.length;f++)e=u[f],$(n).append(new Option(e[r],e[i]));$(n).selectpicker("refresh");$(n).selectpicker("val",t)})};this.CambioProvincia=function(n,t,i){LimparSelectPicker(i);LimparSelectPicker(t);let r=$(n).val();console.info("Provincia Id:"+r);r!=0&&($(t).prop("disabled",!1),this.CargarCantones(r,t))};this.CargarCantones=function(n,t){let i="Canton/ListarPorProvincia/"+n,r="PkCanton",u="Nombre";$backend.GetToBackend(i).then(n=>{var i,f;for(console.log(n),i=0;i<n.length;i++)f=n[i],$(t).append(new Option(f[u],f[r]));$(t).selectpicker("refresh")})};this.CargarCantonesSelected=function(n,t,i){let r="Canton/ListarPorProvincia/"+n,u="PkCanton",f="Nombre";console.log("Seleccionar: "+i);$backend.GetToBackend(r).then(n=>{var r,e;for(console.log(n),r=0;r<n.length;r++)e=n[r],$(t).append(new Option(e[f],e[u]));$(t).selectpicker("refresh");$(t).selectpicker("val",i)})};this.CambioCanton=function(n,t){LimparSelectPicker(t);let i=$(n).val();console.info("Canton Id:"+i);i!=0&&($(t).prop("disabled",!1),this.CargarDistritos(i,t))};this.CargarDistritos=function(n,t){let i="Distrito/ListarPorCanton/"+n,r="PkDistrito",u="Nombre";$backend.GetToBackend(i).then(n=>{var i,f;for(console.log(n),i=0;i<n.length;i++)f=n[i],$(t).append(new Option(f[u],f[r]));$(t).selectpicker("refresh")})};this.CargarDistritosSelected=function(n,t,i){let r="Distrito/ListarPorCanton/"+n,u="PkDistrito",f="Nombre";console.log("Seleccionar: "+i);$backend.GetToBackend(r).then(n=>{var r,e;for(console.log(n),r=0;r<n.length;r++)e=n[r],$(t).append(new Option(e[f],e[u]));$(t).selectpicker("refresh");$(t).selectpicker("val",i)})}}function LimparSelectPicker(n){$(n).find("option").not(":first").remove();$(n).prop("disabled",!0);$(n).selectpicker("refresh")}const $geografia=new Geografia;